import React from 'react';
import { Card, Avatar } from 'antd';

const dummy = {
    nickname: 'Jsn',
    post: [],
    followings: [],
    followers: [],
    isLoggedIn: false,
};

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key="twit">트윗</div>,
                <div key="followings">팔로잉</div>,
                <div key="followers">팔로워</div>
            ]}
        >
            <Card.Meta
                avatar={<Avatar>{dummy.nickname}</Avatar>} 
                title={dummy.nickname}
            />
        </Card>
    );
};

export default UserProfile;
